const Discord = require("discord.js");
const fs = require("fs");
let xp = require("./xp.json");

let xpAdd = Math.floor(Math.random() * 1) + 8;

  if(!xp[msg.author.id]){
    xp[msg.author.id] = {
      xp: 0,
      level: 1
    };
  }


  let curxp = xp[msg.author.id].xp;
  let curlvl = xp[msg.author.id].level;
  let nxtLvl = xp[msg.author.id].level * 400;
  xp[msg.author.id].xp = curxp + xpAdd;
  if(nxtLvl <= xp[msg.author.id].xp){
    xp[msg.author.id].level = curlvl + 1;
    let lvlup = new Discord.RichEmbed()
    .setTitle("NOWY LEVEL!")
    .setColor("#b12cbf")
    .addField("Obecny level", curlvl + 1);

    msg.channel.send(lvlup).then(msg => {msg.delete(5000)});
  }
  fs.writeFile("./xp.json", JSON.stringify(xp), (err) => {
    if(err) console.log(err)
  });
